import { getAuth, onAuthStateChanged } from "firebase/auth";
import Login from "../Components/Login/Login";
import Home from "../Components/Home/Home";

function Main() {
  const auth = getAuth();
  onAuthStateChanged(auth, (user) => {
    if (user) {
      const uid = user.uid;
      return <Home />;
    } else {
      return <Login />;
    }
  });

  return <Login />;
}

export default Main;
